import React, { useState } from 'react';
import styled from 'styled-components';
import Friend from './Friend';

const FriendsListBlock = styled.div`
  width: 45%;
  max-height: 650px;
  border: 1px solid black;
  overflow-y: auto;
`;

const friendsList = [
  { profileImage: '1646621980718.jpg', nickname: '123' },
  { nickname: 'nani' },
  { nickname: 'abcd' },
];

const FriendsList = () => {
  return (
    <FriendsListBlock>
      {friendsList.map((friend) => (
        <Friend profileImage={friend.profileImage} nickname={friend.nickname} />
      ))}
    </FriendsListBlock>
  );
};

export default FriendsList;
